import {get, del, post, put, upload} from "./HttpService";
import endpoints from "../config/endpoints";

export default class AccessCodeService {
    static search(dataSearch = {nextToken: "", limit: 10, query: {}}) {
        return get(endpoints.accessCodeManagement.list, dataSearch).then(value => {
            return value ? value.data : null;
        });
    }

    static remove(id) {
        return del(endpoints.accessCodeManagement.delete.replace(":ID", id)).then(value => {
            return value ? value.data : null;
        });
    }

    static get(id) {
        return get(endpoints.accessCodeManagement.get.replace(":ID", id)).then(value => {
            return value ? value.data : null;
        });
    }

    static getCodes(id, dataSearch) {
        return get(endpoints.accessCodeManagement.getCodes.replace(":ID", id), dataSearch).then(value => {
            return value ? value.data : null;
        });
    }

    static update(id, item) {
        return put(endpoints.accessCodeManagement.update.replace(":ID", id), item).then(value => {
            return value ? value.data : null;
        });
    }

    static updateKey(item) {
        return put(endpoints.accessCodeManagement.updateKey, item).then(value => {
            return value ? value.data : null;
        });
    }

    static createKey(item) {
        return post(endpoints.accessCodeManagement.updateKey, item).then(value => {
            return value ? value.data : null;
        });
    }

    static clone(id) {
        return post(endpoints.accessCodeManagement.clone.replace(':ID', id)).then(value => {
            return value ? value.data : null;
        });
    }

    static create(item) {
        return post(endpoints.accessCodeManagement.create, item).then(value => {
            return value ? value.data : null;
        });
    }

    static upload(file) {
        var formdata = new FormData();
        formdata.append("file", file);
        return upload(endpoints.accessCodeManagement.upload, formdata).then(value => {
            return value ? value.data : null;
        });
    }
}
